[PR/Gifted] BeautyBay recently launched their 2 new Baked Highlighter Trio Palettes. Peachy Glow is my favourite of the 2 and is much more suited to my fair skin. The star of the show is definitely the shade Cloud, which has the most stunning peach/orange glow. It might not be the most natural, everyday glow for everyone's taste, but I personally love it! The centre shade Peach is a beautiful blushlight, which isn't a far-off dupe of Milani's Bella Bellini. It's as if Luminoso and Bella Bellini had a baby, but with less gold shimmer and a better formula (in my opinion)
@beautybaycom

